function destroyer(...arr) {
  // Remove all the values
  let newArr = [];
  for (let i = 1; i <= arr.length - 1; i++) {
    for (let j = 0; j <= arr[0].length - 1; j++) {
      console.log(j);
      if (arr[i] == arr[0][j]) {
        arr[0].splice(j, 1);
        j--;
      }
    }
  }
  newArr = arr[0].slice();
  return newArr;
}
